package datatypes;

public class Result_of_expressions {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int x,y,z;
     x=10 + 2 * 5;
     y=(10 + 2) * 5;
     z=100 / 5 + 2 * 3 - 4;
    System.out.println("Value of 10 + 2 * 5 = "+x);
    System.out.println("Value of (10 + 2) * 5 = "+y);
    System.out.println("Value of 100 / 5 + 2 * 3 - 4 = "+z);
	}

}
